export const Prices = (props) => {
	return(
		<>
			<h2>Prices</h2>
			<small>{props.bpi.disclaimer}</small>
			<h3>Last updated @: {props.bpi.time.updated}</h3>
			<ul>
				<li>
					Bitcoin rate for {props.bpi.bpi.description} {props.bpi.bpi.USD.rate_float}{props.bpi.bpi.USD.code}
				</li>
			</ul>

		</>
	)
}
